    function selectNext() {
        var $highlighted = $('td.reference.highlighted');

        if (selected) {
            var selectedReference = $(selected).attr('id');
            if (selectedReference) {

            }
        }
    }

        if (event.keyCode == 114) { // F3

            // Remap F3 to some other key that the browser doesn't care about
            selectNext();
        }
    });
});</script>
